import React, { useState, useEffect } from "react";
import "./ProductPage.css";
import CatalogCard from "../../Components/CatalogCard/CatalogCard";
import axios from "../../utils/axios";
// import image from '../../image/main-page-bg.jpg'

function ProductPage() {
    const [products, setProducts] = useState([""]);
    useEffect(() => {
        const fetching = async () => {
            try {
                const { data } = await axios.get("/product-info");
                setProducts(data);
            } catch (err) {
                console.log(err);
            }
        };
        fetching();
    }, []);
 const productBuy=async (e)=>{
    const data=products[e]
    const productBuyData={
        name: data.name,
        price: data.price
    }
    
 }

    return (
        <main className="product-catalog">
            <div className="catalog-body">
                {products.map((product,index)=>(
                <CatalogCard key={product.id} product={product} productBuy={productBuy} index={index} />
            ))}
                
            </div>
        </main>
    );
}

export default ProductPage;
